import React from 'react';
import GetMyCabins from './GetMyCabins';
import {getAdmin} from "../../../Utils/Common";


export default function MyCabins(){

    const user_id = this.props.location.state;


    if (getAdmin() == false)
    {
    return(
        <div>
            <h3>My Cabins</h3>
            <GetMyCabins id={sessionStorage.getItem("user_id")}/>
        </div>
    )
    }

    else
    {
    return(
        <div>
            <GetMyCabins id={user_id}/>
        </div>
    )
    }
}
